<script type="text/javascript">
    var isCharacter = function(x){
                var firstLetter = x.charAt(0).toUpperCase();
                if( firstLetter.toLowerCase() != firstLetter) {
                    return true;
                }
                else {
                    return false;
                }
            };
            var isDigit = function(x){
                var cc = x.charCodeAt(0);
                if( cc >= "0".charCodeAt(0) && cc <= "9".charCodeAt(0) ) {
                    return true;
                }
                else {
                    return false;
                }
            };
            var filterValues = function(v){
                var x = null,
                        y = null,
                        z = null,
                        w = null;
                if (typeof v === "number"){
                    return v;
                }
                for (var n in v){
                    var value = v[n];
                    if (n === "x"){
                        x = value;
                    } else if (n === "y"){
                        y = value;
                    } else if (n === "z"){
                        z = value;
                    } else if (n === "w"){
                        w = value;
                    } else {
                        debugger;
                    }
                }
                if (w === null){
                    return [x,y,z];
                }
                return [x,y,z,w];
            }
            var jsonify = function(v){
                var res = "";
                isInLeftStatement = false;
                for (var i= v.length-1;i>=0;i--){
                    var c = v.charAt(i);
                    if (isInLeftStatement){
                        if (!isCharacter(c)){
                            isInLeftStatement = false;
                            res = "\"" + res;
                        }
                    }
                    res = c + res;
                    if (c==='.' && i > 0 && !isDigit(v.charAt(i-1))){
                        res = "0" + res;
                    }
                    if (c === ':'){
                        isInLeftStatement = true;
                        res = "\"" + res;
                    }
                }
                return "{"+res+"}";
            }
    function parseAnim(val){
        var i;
        var res = {
            m_RotationCurves: [],
            m_PositionCurves: []
        };
        var currentCurve = [];

        var addCurve = function(){
            do{
                var line = lines[i];
                i++;
            } while (line.indexOf('m_Curve')===-1);

            while (lines[i].trim().indexOf('-') === 0){
                var obj = {};
                currentCurve.push(obj);

                obj.time = JSON.parse(jsonify(lines[i].substring(lines[i].indexOf('-')+1))).time;
                i++;
                obj.value = filterValues(JSON.parse(jsonify(lines[i])).value);
                i++;
                obj.inSlope = filterValues(JSON.parse(jsonify(lines[i])).inSlope);
                i++;
                obj.outSlope = filterValues(JSON.parse(jsonify(lines[i])).outSlope);
                i++;
                obj.tangentMode = JSON.parse(jsonify(lines[i])).tangentMode;
                i++;
            }
        };
        var lines = val.split("\n");
        for (i=0;i<lines.length;i++){
            var line = lines[i];
            if (line.indexOf('m_PositionCurves') !== -1){
                currentCurve = res.m_PositionCurves;
                addCurve();
            } else if (line.indexOf('m_RotationCurves') !== -1){
                currentCurve = res.m_RotationCurves;
                addCurve();
            } else if (line.indexOf('m_ScaleCurves') !== -1){
                currentCurve = [];
            }
        }
        return JSON.stringify(res);
    }

    function convertCurveOnly(){
        var input = document.getElementById('input');
        var output = document.getElementById('output');
        var lines = input.value.split("\n");
        var currentCurve = [];

        var i = 0;
       while (lines[i].trim().indexOf('-') === 0){
           var obj = {};
           currentCurve.push(obj);

           obj.time = JSON.parse(jsonify(lines[i].substring(lines[i].indexOf('-')+1))).time;
           i++;
           obj.value = filterValues(JSON.parse(jsonify(lines[i])).value);
           i++;
           obj.inSlope = filterValues(JSON.parse(jsonify(lines[i])).inSlope);
           i++;
           obj.outSlope = filterValues(JSON.parse(jsonify(lines[i])).outSlope);
           i++;
           obj.tangentMode = JSON.parse(jsonify(lines[i])).tangentMode;
           i++;
       }

        output.innerHTML = JSON.stringify(currentCurve);
    }


    function convert(){
        var input = document.getElementById('input');
        var output = document.getElementById('output');

        output.innerHTML = parseAnim(input.value);
    }
</script>
